    let HomeProductData = props.HomeProducts
    useEffect(() => {
        // apiData();
        // let pdata = productData
        console.log(HomeProductData,"data")
    }, []);

    return (
        <>
            <div className="homeBody">
                <Navbar />
                {/* <Banner/> */}
                <Main proData={HomeProductData} />
            </div>
        </>
    )
}

export default Home
